    public static int[] mergesort(int[] array) {
        if (array.length <= 1) {
            return array;
        }

        // Dividir el arreglo a la mitad
        int[] left = new int[array.length/2];
        int[] right = new int[array.length - left.length];
        System.arraycopy(array, 0, left, 0, left.length);
        System.arraycopy(array, left.length, right, 0, right.length);

        // Ordenar cada mitad recursivamente
        mergesort(left);
        mergesort(right);

        // Combinar las dos mitades ordenadas en un solo arreglo
        merge(left, right, array);

        return array;
    }

    private static void merge(int[] left, int[] right, int[] result) {
        int i = 0;
        int j = 0;
        int k = 0;

        while (i < left.length && j < right.length) {
            if (left[i] <= right[j]) {
                result[k++] = left[i++];
            } else {
                result[k++] = right[j++];
            }
        }

        // Copiar los elementos restantes de la mitad izquierda
        while (i < left.length) {
            result[k++] = left[i++];
        }

        // Copiar los elementos restantes de la mitad derecha
        while (j < right.length) {
            result[k++] = right[j++];
        }
    }

    private static void imprimirArreglo(int[] array) {
        System.out.println("Cantidad de elementos: "+array.length);
        for (int i = 0; i < array.length; i++) {
            System.out.print(array[i]);
            if (i != array.length-1) {
                System.out.print(",");
            }
            if ((i+1) % 30 == 0) {
                System.out.println();
            }
        }
    }


